import React, { FC } from 'react'
import styles from './button.module.css'
import { Link, Route } from 'react-router-dom'

const Popup = React.lazy(() => import('../../../PopupTweet/PopupTweet'))

type ClickType = {
  onClickHandler?: () => void
}

export const Button: FC<ClickType> = ({ onClickHandler }) => {
  const ClickHandler = () => {
    if (onClickHandler) {
      onClickHandler()
    }
  }

  return (
    <>
      <Link to="/popup">
        <Route
          path="/popup"
          render={() => {
            return (
              <React.Suspense fallback={<div>Loading...</div>}>
                <Popup />
              </React.Suspense>
            )
          }}
        />
        <button type="submit" className={styles.buttonTweet} onClick={ClickHandler}>
          Tweet
        </button>
      </Link>
    </>
  )
}

export default Button
